   background: rgb(50,142,65);
  // background: linear-gradient(90deg, rgba(50,142,65,1) 4%, rgba(70,106,166,0.938813025210084) 100%, rgba(0,212,255,1) 100%);
`;

const WhyusContainer = styled.div`
  
//background: #000;
    width: 90%;
    height: 450px;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: top;
    margin-bottom: 5%;
 
`;

const WhyusContainer1 = styled.div`
  
 
    width: 100%;
    height: 300px;
    background: #999;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: top;
    margin-bottom: 5%;
 
`;


const ServicesContainer = styled.div`
  
 
    width: 90%;
    height: 300px;
    background: #999;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: bottom;
    margin-bottom: 5%;
    border-radius: 50px;
 
`;



const Img = styled.img`
  
 
     width: 100%;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: top;
    margin-bottom: 5%;
    margin-top: 3%;
    border-radius: %;
    
 
`;


const Home = () => {
  return (
    <div>
      <AppContainer >
        <h1 style={{ display: 'flex', justifyContent: 'center', alignItems: 'top', height: '100%' }}>home</h1>
        <WhyusContainer >
          <Img src={Whyusimgtom} width='80%' height='60px' alt="top" />

          <WhyusContainer1 >


          </WhyusContainer1>







        </WhyusContainer>




        
        <ServicesContainer>
        <h1 style={{ display: 'flex', justifyContent: 'center', alignItems: 'top', height: '100%' }}>ServicesContainer</h1>

        </ServicesContainer>


      </AppContainer>
    </div>
  );
};

export default Home;
